// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awTileRenderFunction } from 'js/AwTileService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwTileService', () => import('js/AwTileService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awTileRenderFunction",
            "deps": "js/AwTileService"
        }
    },
    "data": {
        "resizeSvg": "",
        "tile": {}
    },
    "i18n": {
        "resizeCommandTitle": [
            "UIMessages"
        ],
        "unpinCommandTitle": [
            "UIMessages"
        ]
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "tile": {
            "type": "object"
        }
    },
    "_viewModelId": "AwTile",
    "_uniqueViewModelId": "AwTile",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awTileRenderFunction, undefined, ctxImportObj );

export default Component;
